import React from 'react'

function Message(props) {
    return (
        <div>
            <Card>
                <CardContent>
                    <Typography 
                        variant="h5"
                        color="white"
                        component="h2"
                    >
                        {props.username}: {props.text}
                    </Typography>
                </CardContent>
            </Card>
        </div>
    )
}

export default Message
